import React, { Component } from 'react'

export default class Tournaments extends Component {

    constructor(props){
        super(props);
        this.state={tournaments:[]}
    }

    componentWillMount(){
        fetch('http://localhost:8000/tennis')
        .then(res => {res.data})
        .then(resu => {this.setState({...this.state,tournaments:resu})});
    }


    render() {
        console.log(""+this.state.tournaments);
        return (
            <div>
                {this.state.tournaments.map(tournament => {
                    return <tr>{tournament.event_name}</tr>
                })
                }

            </div>
        )
    }
}
